import React, { Component } from "react";
import { Switch, BrowserRouter, Route, Redirect , IndexRoute } from "react-router-dom";
import Menu from "./Component/Menu";
import Home from "./Pages/Home";
import Gozareshat from "./Pages/Gozareshat";
import Setting from "./Pages/Setting";
import ResultItem from "./Pages/ResultItem";
import NotFound from "./Pages/NotFound";
import TowerDetail from "./Pages/TowerDetail";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <section className="rtl container-fluid h-100">
          <div className="row h-100">
            <Menu />
            <Switch>
              <Redirect exact from="/" to="/Home" />
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/Home/:id">
                <TowerDetail />
              </Route>
              <Route exact path="/Gozareshat">
                <Gozareshat>
                <ResultItem />

                </Gozareshat>
              </Route>
              <Route path="/Gozareshat/:id">
                    <ResultItem />
                  </Route>

              <Route path="/Setting">
                <Setting />
              </Route>

              <Route exact path="/Home">
                <Home />
              </Route>

              <Route path="*">
                <NotFound />
              </Route>
            </Switch>
          </div>
        </section>
      </BrowserRouter>
    );
  }
}

export default App;
